script: |
  super -f text -I q8884.spq | sort > q8884.out

inputs:
  - name: q8884.spq
    data: |
      SELECT CAST ( - CAST ( 66 AS INTEGER ) AS INTEGER ) AS col2 FROM tab2 (FORMAT parquet) WHERE NOT ( + col2 - CAST ( - col1 + + col0 AS INTEGER ) * + col1 ) NOT IN ( col1 );
  - name: tab2

outputs:
  - name: q8884.out
    data: |
